// src/pages/SkillTreePage.js
import React from 'react';
import ReactFlow from 'react-flow-renderer';

const nodes = [
  { id: '1',       type: 'input',  data: { label: 'Start Here' },                      position: { x: 250, y: 0   } },
  { id: 'surgery', data: { label: 'Oral Surgery' },                                     position: { x: 100, y: 150 } },
  { id: 'ortho',   data: { label: 'Orthodontics' },                                     position: { x: 250, y: 150 } },
  { id: 'endo',    data: { label: 'Endodontics' },                                      position: { x: 400, y: 150 } },
  { id: 'restor',  data: { label: 'Restorative Dentistry' },                           position: { x: 100, y: 300 } },
  { id: 'implant', data: { label: 'Implant Dentistry' },                               position: { x: 250, y: 300 } },
  { id: 'radio',   data: { label: 'Radiology' },                                        position: { x: 400, y: 300 } },
  { id: 'tmd',     data: { label: 'TMD / Orofacial Pain' },                             position: { x: 250, y: 450 } },
];

const edges = nodes.slice(1).map(n => ({
  id: `e1-${n.id}`,
  source: '1',
  target: n.id,
  animated: true,
}));

export default function SkillTreePage() {
  return (
    <div style={{ height: '100vh' }}>
      <ReactFlow elements={[...nodes, ...edges]} fitView />
    </div>
  );
}
